import React from 'react';
import './RecValue.css';
import { Divider } from '@material-ui/core';


const RecValue = props => {
    function renderData() {
        
        return props.concepts.map(item => (
            <div>
                { props.concepts ?  renderData() : <div>Loading....</div> }
            <tr key={item.id}>
                <td>{item.name}</td>
                <td>{item.value}</td>
            </tr>
            </div>            
        )
        )
    } 
        return (
            
            <table>
            <thead>
                <th>Ingredients</th>
                <th>Value</th>
            </thead>
            <tbody>
            {renderData()}
            </tbody>
            </table>
            
        )
    }

export default RecValue;
